INSERT INTO `event_description` (`_id`, `id`, `name`, `type`, `description`, `quote`, `rules`, `image_link`, `date`, `contact_name_1`, `contact_number_1`, `contact_name_2`, `contact_number_2`, `contact_name_3`, `contact_number_3`, `internship_offers`, `internship_image`) VALUES
(1, 'codeproposal', 'Code Proposal', 'technical', '<p>This is for all the logic aficionados out there who have fallen in love with the ever enigmatic &ldquo;GREEN TICK&rdquo; multiple times. Brace yourselves to get your programming skills tested this ITRIX at our (sorry&hellip;) your code proposal.</p>\n<p><strong>Internship offers at&nbsp;<a href="http://www.bahwancybertek.com/">Bahwan CyberTek</a></strong></p>\n<p>ROUND 1: Prelims - A written round consisting of questions based on Data Structures, Algorithms and Programming logic.</p>\n<p>ROUND 2: Finals - This round will be held in SPOJ.</p>\n<p>&nbsp;</p>', '<p>Man proposes, Computer disposes</p>', '<p>1. Individual participation.<br />2. Participants involved in any kind of malpractice will be immediately disqualified.</p>\n<p><strong>Internship offers at&nbsp;<a href="http://www.bahwancybertek.com/">Bahwan CyberTek</a></strong></p>', NULL, 'Will be updated soon.', 'Aravindan C', '+91 7299293834', '', '', '', '', NULL, NULL),
(3, 'backtrack', 'Backtrack', 'technical', '<p>We believe one can pull more rabbits out of the hat by reverse engineering. Wave your engineering wands to surprise us at Backtrack, an event focussed on reversing one''s way to success.</p>\n<p>ROUND 1: Prelims - Written round consisting of various reverse coding questions.</p>\n<p>ROUND 2: Finals &ndash; Same format as Prelims. Coding has to be done on computer.</p>\n<p><strong>Intern @ <a href="https://www.guvi.in">Guvi</a></strong></p>', '<p>Reversing gravity might result in an interesting love story like in upside down, but reversing the code, way better.</p>', '<p>1. Team size: 1 - 2.<br />2. Cross-college teams are allowed.<br />3. A participant cannot be a member of more than one team.</p>\n<p><strong>Note :</strong></p>\n<p>Reverse Coding:&nbsp;While solving problems, you will be given a problem statement for which you will think of logic and solve it.&nbsp;Here, you will be given only the input and output of some problem. You have to figure out the problem statement yourself and write code for it.</p>\n<p><br /><span>Intern @&nbsp;</span><a href="https://www.guvi.in">Guvi</a></p>', NULL, 'Will be updated soon.', 'Lakeesh Anand A N ', '+91 8056249067', '', '', '', '', NULL, NULL),
(4, 'waronroad', 'War on road', 'technical', '<p>Did you just think coding is yet another bland geeky activity? Does knocking some sense into computer in a dingy cubicle sound claustrophobic? Then, think twice. Battle lines are drawn for an unorthodox coding contest this year. You all are welcome to experience a coding bliss.</p>\n<p><strong>Internship offers at <a href="http://www.cns-inc.com/">CNSI</a></strong></p>\n<p>ROUND 1: Prelims - Written round consisting of various programming questions.</p>\n<p>ROUND 2: Finals - Surprise!! Come and participate !!</p>', '<p>Code under the sun and stars, under the trees, in the bushes, kill the bugs, code a way to your heart''s contempt</p>', '<p>1. Team size: 1 - 2.<br /> 2. Cross-college teams are allowed.<br /> 3. A participant cannot be a member of more than one team.</p>\n<p><strong>Internship offers at&nbsp;<a href="http://www.cns-inc.com/">CNSI</a></strong></p>\n<p>&nbsp;</p>', NULL, 'Will be updated soon.', 'Abilash R S ', '+91 9840516803', '', '', '', '', NULL, NULL),
(5, 'enigma', 'Enigma', 'non-technical', '<p>If number crunching is a habit that defines your identity, then partake in our Enigma aka math event. Integrate your skills to differentiate yourself.</p>', '<p>Only in math, a person buying 70 sofa sets and 100 watermelons makes sense and it&rsquo;s not weird.</p>', '<p>1. Team of size 1-2</p>\n<p>2. Participants involved in any kind of malpractice will be immediately disqualified.</p>', NULL, 'Will be updated soon.', 'Saravanakumaran M', '+91 9159453210', 'Karthikeyan D', '+91 8015240099', 'Kathir', '+91 9585844597', NULL, NULL),
(6, 'buzztime', 'Buzz Time', 'non-technical', '<p>Our good old quiz contest is back. Buzz time is here to revive those nostalgic general knowledge contests. Give it a shot to demonstrate your awareness. And don&rsquo;t forget the clock will be ticking.</p>', '<p><span>Live daringly, boldly, fearlessly. Taste the relish to be found in competition - in having put forth the best within you.</span></p>', '<p>1. Team of size 1-3.</p>\n<p>2. Buzz time welcomes all UG/Masters students with open arms.</p>\n<p>3. Cross-college teams are allowed.</p>\n<p>4. The quiz will deal with generalia ranging from sports to world-polity.</p>', NULL, 'Will be updated soon.', 'Vasantha Kumar', '+91 8903459489', 'Sanjay Kanna ', '+91 9629478847', ' ', '', NULL, NULL),
(7, 'gamindrome', 'Gamindrome', 'non-technical', '<div>\n<p class="Standard">Become a Gamindrome member to showcase your gaming talents this Itrix.&nbsp; Concentrate, Play your game and don''t be afraid to win. Get ready for the ultimate gaming challenge!!</p>\n</div>', '<p>All work and no play makes jack a dull boy</p>', '<div>\n<p class="Textbody">1. Counter Strike 1.6<br /> A Maximum of 5 members per team (cross-college teams are permitted) Each team will play 6 rounds ( 3 as CT and another 3 as terrorists ).<br /> 2. FIFA 14<br /> Each half will be of 4 minutes and every round is a knockout.<br /> 3. NFS Most Wanted<br /> Every round is a knockout and the final round will be a sprint.All other rounds will be circuit races.<br /> <strong>General rules</strong>:-<br /> Students should bring their own headsets.<br /> Game pads are allowed but will not be provided.</p>\n</div>', NULL, 'Will be updated soon.', 'Vengatesh', '+91 9003034142', '', '', '', '', NULL, NULL),
(8, 'photogenic', 'Photogenic', 'online', '<p>The art of photography has evolved over these years with elevating technology to assist new ideas.</p>\n<p>Photogenic 2k16 is here to assess your photography skills in the aspects of creativity and morality. We give you the opportunity to share with us your expressions of joy, humour, sorrow or several others through this very art.Surprise Us!!!</p>', '<p>"A great photograph is one that fully expresses what one feels, in the deepest sense,about what is being photographed." -<em>Ansel Adams</em></p>', '<p>1. Online submissions only. Send your pictures to <a href="mailto:digihunt2016@gmail.com">digihunt2016@gmail.com</a><br />2. Attach your NAME, COLLEGE NAME, IMAGE PROOF OF YOUR COLLEGE ID along with the picture.<br />3.Submitted material must exhibit a minimal of 1600 pixels in width or height. A contestant is allowed to submit a max. of 3 images of not more than 5MB each.<br /> 4.A suitable caption will be encouraged. [Optional] Basic editing is acceptable, provided that it doesn''t affect the authenticity of the original.<br /> 5.High Dynamic Range images [HDR] and panoramas are prohibited. Any picture format [JPEG, PNG, GIF] is allowed.<br /> 6.Photographs received after the deadline will not be assessed.</p>\n<p style="text-align: center;"><strong>DEADLINE: 24-FEB-2016</strong></p>\n<p><strong>THEMES</strong></p>\n<p>1.Friends and family in their best light.</p>\n<p>2.Let''s eat.</p>\n<p>3.Summer colors.</p>', NULL, 'Will be updated soon.', 'Nandhini S', '+91 9445205766', 'Sudhir Kumar ', '+91 9790704778', '', '', NULL, NULL),
(9, 'extempore', 'Extempore', 'non-technical', '<div>\n<p class="Textbody">Doors are wide open to all those who can make beleivers out of their audience with their silver tongue.Clear your mind,Collect your thoughts,polish up on your vocabulary and deliver your ideas.Walk into our cabin and stand a chance to lead the masses.</p>\n<p class="Textbody"><strong>Internship offers at <a href="http://www.pagalguy.com/">Pagalguy</a></strong></p>\n</div>', '<p>Speech is Power; Speech is to persuade; to convert; to compel</p>', '<div>\n<p class="Textbody">1. A topic will be given to you along with a preparation time of 3 minutes.<br /> 2. You must present your points in a pleasing manner and you need not beat around the bush.<br /> 3. Individual Participation is expected.</p>\n<p class="Textbody"><strong>Internship offers at&nbsp;<a href="http://www.pagalguy.com/">Pagalguy</a></strong></p>\n</div>', NULL, 'Will be updated soon.', 'Joseph Pravin ', '+91 8903422838', '', '', '', '', NULL, NULL),
(10, 'prisonerofazkaban', 'Prisoner of Azkaban', 'non-technical', '<p>Step into the thinking cave of ITRIX-16. Cudgel your brains to piece together confounding puzzles, decode cryptic characters, solve interesting math puzzles and have fun hunting a treasure.</p>', '<p>Brain is meant to be used not rusted</p>', '<p>1.Team Size - Maximum of 3<br /> 2.Lone wolves are not allowed.<br /> 3.Participants involved in any kind of malpractice will be immediately disqualified.</p>', NULL, 'Will be updated soon.', 'Ajay', '+91 8754860499', 'Harinni KK ', '+91 9566241836', 'Hima Bindhu ', '+91 9445764630', NULL, NULL),
(11, 'ozero', 'O(Zero)', 'online', '<p>Enter the world of binaries, keywords, logic and of course problem solving.&nbsp; Code warriors-brace up to lock horns with coders spread across the world in OLPC. See your coding skills put to test this ITRIX.</p>\n<p>A typical ACM ICPC Style Programming Contest to be conducted in Codechef.</p>\n<p><strong>Event Date : Feb 20, 2016</strong></p>\n<p><strong>Event Time: 7.30 pm - 10.00 pm</strong></p>\n<p><strong>Event Url &nbsp; :&nbsp;<a href="https://www.codechef.com/ITRX2016">https://www.codechef.com/ITRX2016</a></strong></p>\n<p>&nbsp;</p>', '<p>Structure the keywords for the system to understand and obey your orders so it can solve the problem at hand</p>', '<p>1. Individual participation.</p>\n<p>2. Participants involved in any kind of malpractice will be immediately disqualified.</p>\n<p>3. Duration : 3 hours (subjected to extension)</p>', NULL, 'Will be updated soon.', 'Lakshmi Narayanan N V ', '+91 9092136573', '', '', '', '', NULL, NULL),
(12, 'gameofthrones', 'Game of Thrones', 'online', '<p>Nothing keeps us guessing like GOT. ITRIX''s event of the same name is to keep that unpredictability alive. Prove to us that you know more by mazing through the unknowns aided by clues.</p>\n<p><strong>Battle has started. <a href="http://www.itrix.in/got">Go to Battle &gt;&gt;</a></strong></p>', '<p>You know nothing Jon Snow</p>', '<p>1. Individual participation.&nbsp; Level based event.</p>\n<p>2. Click Forum button to load the latest comments of the level.</p>\n<p>3. The Clues may possibly be in html comments, url of the image, page refresh.</p>', NULL, 'Will be updated soon.', 'Thangaram', '+91 9488080780', '', '', '', '', NULL, NULL),
(13, 'beatthebug', 'Beat the bug', 'technical', '<p>Do bugs in code give birth to the &ldquo;code Ramanujan &ldquo; in you? Guess what.. Beat the bug is the right event for you. All we ask of you is to clean the code of bugs this ITRIX.</p>\n<p><strong>Internship offers at <a href="https://juspay.in/">JusPay</a></strong></p>\n<p>ROUND 1 : Prelims &ndash; A written round consisting of various debugging questions.</p>\n<p>ROUND 2 : Finals &ndash; You will be given the code which may or may not have logical/syntactic bugs.&nbsp; You have to identify the errors and fix them.</p>', '<p>Secure what can be secured, clean the city out, neighbourhood by neighbourhood, street by street until the rats have nowhere left to hide.</p>', '<p>1. Team size: 1 - 2.<br /> 2. Cross-college teams are allowed.<br /> 3. Participants involved in any kind of malpractice will be immediately disqualified.</p>\n<p><strong>Internship offers at&nbsp;<a href="https://juspay.in/">JusPay</a></strong></p>', NULL, 'Will be updated soon.', 'Krishna N ', '+91 8122978909', '', '', '', '', NULL, NULL),
(14, 'webtrix', 'WebTrix', 'technical', '<p>You think you have a knack for building the real estate of internet, ''Websites''? Then Webtrix is the exclusive arena for you to enthral the people with your skills and prove us that you are indeed a ''Pro''.</p>', '<p>The next Google or Facebook is in your hands, start building.</p>', '<p>1.&nbsp;Team of size 1-2.<br /> 2. Cross-college teams are allowed.<br /> 3. Both front-end and back-end development skills will be tested.</p>', NULL, 'Will be updated soon.', 'Prathap B', '+91 7200796759', '', '', '', '', NULL, NULL);
