INSERT INTO `workshop_description` (`id`, `workshop_id`, `workshop_name`, `conducted_by`, `workshop_image`, `workshop_description`, `workshop_quote`, `prerequisites`, `participation`, `time`, `date`, `reg_link`, `program_id`, `fee`, `transaction_charges`, `total_fee`, `rules`, `agenda`, `mobile_program_id`, `mobile_fee`, `custom-detail-title-1`, `custom-detail-content-1`, `custom-detail-title-2`, `custom-detail-content-2`, `contact_name_1`, `contact_number_1`, `contact_name_2`, `contact_number_2`, `contact_name_3`, `contact_number_3`, `contact_name_4`, `contact_number_4`) VALUES
(4, 'deeplearning', 'Deep Learning', 'Uncanny vision', 'images/workshops/deeplearning.jpg', 'Dive into this workshop to pore over the algorithms that attempt to mimic the human brain to identify objects and surroundings in a context like we do.<br><b>Participant/Participants with good idea may be hired by Uncanny Vision</b>', 'All knowledge is connected to all other knowledge. The fun is in making the connections.', 'Pen drives and laptops are optional<br><b>Participant/Participants with good idea may be hired by Uncanny Vision</b>', 'Individual Participation', ' Half Day', ' 28-02-2016', '#', '685', '500', '16', '516', NULL, NULL, '803', '475', NULL, NULL, NULL, NULL, 'Shelbina A. Jaya', ' +91 9600 210 391', NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'ehack', 'Ethical hacking and Brain Hack', 'InfySec', 'images/workshops/ehack.jpg', 'Have you ever thought of building up a security design, to protect your system from any malicious attacks? The workshop on ''Ethical Hacking'' helps you to check the system for vulnerabilities, so that it is not exploited by any malicious attacker. Ethical Hacking is of emerging trend, where sensitive and classified data have to be prevented from malicious attacker.\n<br><a href="https://www.youtube.com/watch?v=CS8bepq_cfY" target="_blank">Click here to see what NDTV says on InfySec and the workshops conducted by them. </a>', NULL, 'Nothing to specify.', 'Individual Participation', ' Full Day', ' 27-02-2016', '#', '683', '1000', '31', '1031', NULL, 'Intro about Hacking & Ethical Hacking<br>\r\n       Google Dorking |  Cryptography<br>\r\n       Reverse Engineering - Application Cracks<br>\r\n       Trojans, Viruses and Worms<br>\r\n       Web Server Hacking |  Web Application Hacking<br>\r\n       Mobile and Wireless Hacking<br>\r\n       Human/Mind Hacking<br>\r\n       Credit Card Hacks | NexGen Attacks<br>\r\n       Information Security as a Career<br><br>\r\nBrain Hacking :<br><br>Reading people''s Mind, implanting thoughts, predicting behaviour and hacking into the subconscious may sound like science fiction. <br>Using advanced yet natural psychological principles, it is possible to reverse engineer a brain and its working and infact trick it to ones benefit. <br> A walk through of brain hack will be conducted at the end of the workshop.', '805', '950', 'Benefits for participants', 'Goodies will be provided for the quiz winners which will be conducted in between the events.<br>\n         Participants also will be given a life time access to our Live ethical Hacking Lab access, so access will be even available from home.', NULL, NULL, 'Jai Krishnan', ' +91 7418 268 186', NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'eonvirtualrealityandaugmentedreality', 'Eon virtual reality and augmented reality', 'Hi-Tech Software Solutions Chennai Private Limited', 'images/workshops/augmentedreality.jpg', '  "The  Matrix" possibly gave us the fantasy of walking inside computer programs.Though the idea of "The Matrix" is a bit too far-fetched,the concepts of virtual and augmented realities are not really so.If you are curious to have a good grasp of this "reality",then engage in this workshop.', 'What is real? How do you define ''real''? If you''re talking about what you can feel, what you can smell, what you can taste and see, then ''real'' is simply electrical signals interpreted by your brain.', 'Students  must bring their laptops. <br> Students are requested to install 3Dx max software prior to workshop.  <br>', 'Individual Participation', ' Full Day', ' 27-02-2016', '#', '682', '750', '24', '774', NULL, 'Introduction to virtual and augmented reality.<br>\r\nApplication of virtual and augmented reality. <br>\r\nFuture of this technology<br>\r\nHow to build the foundation for  virtual and augmented reality. <br>\r\nBasic criteria needed to get into virtual reality<br>\r\nImpact factor in today''s world<br>\r\nDemonstration at the end.<br>\r\n', '804', '713', NULL, NULL, NULL, NULL, 'Nivedita', ' +91 9677 054 064', NULL, NULL, NULL, NULL, NULL, NULL),
(5, 'fasterforwardacrossinternetwithakamai', 'Faster forward across the internet with Akamai', 'Akamai', 'images/workshops/akamai.jpg', 'We know you are a consumer of content online.So is everyone.But have you ever wondered how a website loads faster? Does the whole concept of quicker online transactions amaze you? Then you are at the right place at the right time.This workshop will introduce you to the nitty-gritty of web content delivery as well as the role of Akamai in it along with an hands-on experience.<br><b>Participant/Participants with good idea may be hired by Akamai</b>', NULL, 'Pendrives and laptops are optional.<br><b>Participant/Participants with good idea may be hired by Akamai</b>', 'Individual Participation', ' Half Day', ' 28-02-2016', '#', '681', '500', '16', '516', NULL, NULL, '806', '475', NULL, NULL, NULL, NULL, 'Shripriyanga', ' +91 9597 127 939', NULL, NULL, NULL, NULL, NULL, NULL),
(1, 'iot', 'Internet of Things', 'IBM', 'images/workshops/iot.jpg', 'Imagine a world in which every device in the home, workplace and schools are connected.We now have smart homes,smart office,smart door and even smart city.Is''nt it time for you to get smart as well to handle all these smart products?IBM provides you an opportunity to understand the concept of Internet Of Things using their Bluemix platform.They provide IoT Data Exploration with Bluemix  - Node Red Editor , Cloudant with a Hands on session.<br>\n<b>Participant/Participants with good idea may be hired by IBM</b>', 'Everything that can be automated will be automated', 'Students are requested to bring their laptops.<br>Students are requested to sign up for a trial IBM Bluemix account.<br> <a href="https://console.ng.bluemix.net/registration/">https://console.ng.bluemix.net/registration/</a><br>Participants are requested to come up with ideas on IOT. <b>Participant/Participants with good idea may be hired by IBM</b>', 'Individual Participation', ' Full Day', ' 28-02-2016', '#', '684', '750', '24', '774', NULL, 'Introduction to Internet Of Things.<br>\nConnect an IoT device to IBM Bluemix Internet Of Things Foundation and play around with the data.<br>\nHands on session on moving data to Bluemix cloud<br>\nIoT Data Exploration with Bluemix - Node Red Editor and Cloudant\n', '802', '713', NULL, NULL, NULL, NULL, 'Sandhya S', ' +91 8056 129 866', NULL, NULL, NULL, NULL, NULL, NULL);
